import React from 'react';
import './background.css';
import wood_background from '../../Assets/wood_background.webp'



const Background = () => (
    
    <div className="background_container">
     style={{ backgroundImage:`url(${wood_background})` }}>
            <img 
            className="wood"
                src={wood_background} 
                />
            <div className="overlay">
                Multi-line <br />text
            </div>
   
        </div>
    
);
export default Background;
